webpackJsonp([56799936929543],{4816:function(t,e){t.exports={pathContext:{group:[{node:{fields:{title:"Phoenix one, Phoenix two",date:"22 May 2000",slug:"/2000-05-22-phoenix-one-phoenix-two/",tags:"Y2000"},html:'<p><a href="http://andrea.editthispage.com/2000/05/22">Andrea\'s Weblog</a>:  "Where do you want to live?  <a href="http://www.stormwerks.com/linked/2000_05_14_archive.html#245935">Zannah</a> had this link to a test where you can <a href="http://homes.wsj.com/d/best.html">find the best place for you to live</a>. (Only places in the USA are available, I think.)"</p>\n<p>I tried it out, and our last home in the US, Phoenix, came out on top. Of course, I deliberately manipulated my answers so that it would (desert climate and low taxes very important, ignore education and culture, but national parks are OK).</p>'},next:{fields:{title:"Kaiser roll",date:"21 May 2000",slug:"/2000-05-21-kaiser-roll/"}},previous:{fields:{title:"Moving",date:"24 May 2000",slug:"/2000-05-24-moving/"}}},{node:{fields:{title:"Kaiser roll",date:"21 May 2000",slug:"/2000-05-21-kaiser-roll/",tags:"Y2000"},html:'<p>Familie Berg describes <a href="http://familieberg.editthispage.com/stories/storyReader$213">Moritz Tagesablauf</a> (in German), the daily routine for the 8 month old Moritz. This all sounds very familiar (especially the part about changing the diaper when it smells suspicious).</p>\n<p>Mama keeps asking me what her plants are called in English. <a href="http://linnaeus.nrm.se/flora/">Den virtuella floran</a> is a multilingual botanical database from Sweden. Alas, the text is all in Swedish, but you can look up common names in a number of languages.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/crh0521.jpg" height="376" width="350" border="0" alt="crh0521.jpg: " /></p>\n<p>It took Christopher just 10 minutes to slide and roll his way the 2 meters from the corner under the teddy bear mobile to just behind Mama\'s desk. We thought it was pretty cute until he started tugging on Mama\'s mouse cable.</p>'},next:{fields:{title:"One of those days",date:"18 May 2000",slug:"/2000-05-18-one-of-those-days/"}},previous:{fields:{title:"Phoenix one, Phoenix two",date:"22 May 2000",slug:"/2000-05-22-phoenix-one-phoenix-two/"}}},{node:{fields:{title:"One of those days",date:"18 May 2000",slug:"/2000-05-18-one-of-those-days/",tags:"Y2000"},html:'<p><a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518013.jpg" height="133" width="100" border="0" alt="crh0518aThumb.jpg: " /></a><br />\n<a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518014.jpg" height="133" width="100" border="0" alt="crh0518bThumb.jpg: " /></a><br />\n<a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518015.jpg" height="133" width="100" border="0" alt="crh0518cThumb.jpg: " /></a><br />\n<a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518013.jpg" height="133" width="100" border="0" alt="crh0518aThumb.jpg: " /></a><br />\n<a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518014.jpg" height="133" width="100" border="0" alt="crh0518bThumb.jpg: " /></a><br />\n<a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518015.jpg" height="133" width="100" border="0" alt="crh0518cThumb.jpg: " /></a><br />\n<a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518013.jpg" height="133" width="100" border="0" alt="crh0518aThumb.jpg: " /></a><br />\n<a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518014.jpg" height="133" width="100" border="0" alt="crh0518bThumb.jpg: " /></a><br />\n<a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518015.jpg" height="133" width="100" border="0" alt="crh0518cThumb.jpg: " /></a><br />\n<a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518013.jpg" height="133" width="100" border="0" alt="crh0518aThumb.jpg: " /></a><br />\n<a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518014.jpg" height="133" width="100" border="0" alt="crh0518bThumb.jpg: " /></a><br />\n<a href="http://shanson.editthispage.com/stories/storyReader$241"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/20000518015.jpg" height="133" width="100" border="0" alt="crh0518cThumb.jpg: " /></a> </p>\n<p>I have to at least give Mama credit for taking the <a href="http://shanson.editthispage.com/stories/storyReader$241">pictures</a>.</p>\n<p><a href="http://dailynews.yahoo.com/h/is/20000516/bs/qxl_ricardo_form_european_web_auction_giant_1.html">QXL, Ricardo Form European Web Auction Giant</a>. Ricardo, based in Hamburg, is being essentially taken over. The 3 founders, all under 40, will be splitting nearly $500 million.</p>'},next:{fields:{title:"Baseball in the morning",date:"17 May 2000",slug:"/2000-05-17-baseball-in-the-morning/"}},previous:{fields:{title:"Kaiser roll",date:"21 May 2000",slug:"/2000-05-21-kaiser-roll/"}}}],pathPrefix:"",first:!1,last:!1,index:1062,pageCount:1101}}}});
